import {
  Route,
  Routes,
} from 'react-router-dom';


import Landing from "./components/landing";


function App() {
  return (
    <>
    <Routes>
      <Route path="/" component={Landing}/>
      <Route path="/" component={Landing} />
    </Routes>
    <Landing />
    <div className="App">
      Hello! this is Raphael...
    </div>
    </>
  );
}

export default App;
